import React, {Component} from "react";
import axios from 'axios';

export default class ItemViewComponent extends Component{

    constructor(props) {
        super(props);
        this.items = [];
    }

    componentDidMount() {
        axios.get('http://localhost:3000/items')
            .then(res =>{
                this.items = res.data;
            });
    }

    tableData(){
        return this.items.map((object) => {

            return (
              <tr>
                  <td>{object.id}</td>
                  <td>{object.name}</td>
              </tr>
            );
        });
    }

    render() {
        return(
            <table>
                <thead>
                    <tr>
                        <th>ID</th>
                        <th>Name</th>
                    </tr>
                </thead>
                <tbody>
                    {this.tableData()}
                </tbody>
            </table>
        );
    }
}
